import React, { useEffect, useState } from 'react';

import NavSearch from '../navSection/NavSearch';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { Link, useParams } from 'react-router-dom';
import axios from 'axios';


import './product.css';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';

import Footer from '../footerSection/Footer';
import ProductDetails from './ProductDetails';
import ExpandLessIcon from '@mui/icons-material/ExpandLess';
import CartCard from '../cartSection/CartCard';
import UseEffectData from '../fetch/UseEffectData';

const product = {
  name: 'jolof rice',
  desc: 'nigeria jolof',
  price: 1200,
  _id: 'kzd',
  kitchenName: 'iyah-dolof kitchen',
  kitchenRating: 2.5,
  verified: false,
  physicalAddress: '30 udeji street lagos island',
  status: 'available',
  content: ['2 portions of rice', '1 chicken lap'],
  imgs: [
    '/images/ghanajolof.jpg',
    '/images/giudau.webp',
    '/images/fdjfkgfgfg.jpg',
  ],
};

const cartItems = [
  {
    name: 'jolof rice',
    desc: 'nigeria jolof',
    price: 1200,
    _id: 'kzd',
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 3.5,
    verified: false,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    content: ['2 portions of rice', '1 chicken lap'],
    imgs: [
      '/images/ghanajolof.jpg',
      '/images/giudau.webp',
      '/images/fdjfkgfgfg.jpg',
    ],
  },
  {
    name: 'jolof rice',
    desc: 'nigeria jolof',
    price: 1200,
    _id: 'kzd',
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 3.5,
    verified: false,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    content: ['2 portions of rice', '1 chicken lap'],
    imgs: [
      '/images/ghanajolof.jpg',
      '/images/giudau.webp',
      '/images/fdjfkgfgfg.jpg',
    ],
  },
  {
    name: 'jolof rice',
    desc: 'nigeria jolof',
    price: 1200,
    _id: 'kzd',
    kitchenName: 'iyah-dolof kitchen',
    kitchenRating: 3.5,
    verified: false,
    physicalAddress: '30 udeji street lagos island',
    status: 'available',
    content: ['2 portions of rice', '1 chicken lap'],
    imgs: [
      '/images/ghanajolof.jpg',
      '/images/giudau.webp',
      '/images/fdjfkgfgfg.jpg',
    ],
  },
];

function Product() {
  const params = useParams();
  const { id } = params;

  const product =UseEffectData(`http://localhost:5000/api/products/find${id}`)

  const [isSmallScreen, setIsSmallScreen] = useState(false);

  useEffect(() => {
    const checkScreenSize = () => {
      setIsSmallScreen(window.innerWidth < 1200);
    };
    checkScreenSize();

    window.addEventListener('resize', checkScreenSize);

    return () => {
      window.removeEventListener('resize', checkScreenSize);
    };
  }, []);

  return (
    <div className="" style={{ overflowX: 'hidden' }}>
      <NavSearch />
      <div
        style={{
          height: isSmallScreen ? '89vh' : 'auto',
          overflowY: isSmallScreen ? 'scroll' : 'visible',
        }}
      >
        <Container>
          <Row className="">
            <Col md={isSmallScreen ? 12 : cartItems.length > 0 ? 9 : 12} className="product  p-3">
              <ProductDetails product={product} />
            </Col>
            {!isSmallScreen && cartItems.length > 0 && (
              <Col md={3} className="my-3">
               <CartCard product={product}/>
              
               <Link to="/cart" className="d-grid my-2 text-decoration-none">
               <Button to="/cart" variant='light' className='text-success border-secondary '>See All</Button>
               </Link>
              
              </Col>
            )}
          </Row>
        </Container>
        <Footer />
      </div>

      {isSmallScreen && cartItems.length > 0 && (
        <Card >
          <Link to="/cart" className="p-2 d-flex align-items-center  justify-content-between text-decoration-none">
            <strong className='text-dark'>Cart(3 Items)</strong>
            <div className="d-flex align-items-center text-success">
              {' '}
              <strong>Total: N157000.00 </strong>
              <ExpandLessIcon className="fs-1 fw-bold" />
            </div>
          </Link>
        </Card>
      )}
    </div>
  );
}

export default Product;
